import React from 'react';

const Step1 = ({ formData, handleChange, groups, nextStep }) => (
  <div>
    <style>
      {`
        .app-container {
          font-family: 'Helvetica', sans-serif;
          max-width: 650px;
          margin: 0 auto;
          padding: 20px;
          background: #1a1a2e;
          min-height: 100vh;
          color: #e0e0e0;
        }
        .header {
          text-align: center;
          padding: 20px;
          background: linear-gradient(135deg, #16213e, #0f3460);
          border-radius: 15px 15px 0 0;
          box-shadow: 0 4px 15px rgba(0, 0, 0, 0.3);
          margin-bottom: 25px;
        }
        .header h1 {
          font-size: 32px;
          font-weight: 700;
          text-transform: uppercase;
          letter-spacing: 2px;
          color: #00d4ff;
        }
        .progress-bar {
          width: 100%;
          height: 12px;
          background: #2a2a40;
          border-radius: 6px;
          overflow: hidden;
          margin-top: 10px;
        }
        .progress {
          width: 33.33%;
          height: 100%;
          background: #00d4ff;
          transition: width 0.4s ease-in-out;
          border-radius: 6px;
        }
        .step-container {
          background: #16213e;
          padding: 35px;
          border-radius: 15px;
          box-shadow: 0 6px 20px rgba(0, 0, 0, 0.4);
          border: 1px solid #2a2a40;
        }
        .step-title {
          font-size: 26px;
          font-weight: 600;
          color: #e94560;
          text-align: center;
          margin-bottom: 30px;
          text-transform: uppercase;
        }
        .form-group {
          margin-bottom: 25px;
        }
        .form-label {
          display: block;
          font-size: 16px;
          font-weight: 500;
          color: #b0b0c0;
          margin-bottom: 10px;
          text-transform: capitalize;
        }
        select, input {
          width: 100%;
          padding: 14px;
          border: 2px solid #2a2a40;
          border-radius: 10px;
          font-size: 16px;
          background: #252a41;
          color: #e0e0e0;
          transition: border-color 0.3s ease, box-shadow 0.3s ease;
        }
        select:focus, input:focus {
          border-color: #e94560;
          box-shadow: 0 0 10px rgba(233, 69, 96, 0.4);
          outline: none;
        }
        .btn {
          display: block;
          width: 100%;
          padding: 16px;
          border: none;
          border-radius: 10px;
          font-size: 16px;
          font-weight: 600;
          cursor: pointer;
          background: #e94560;
          color: white;
          transition: background-color 0.3s ease, transform 0.2s ease;
        }
        .btn:hover {
          background: #ff6b81;
          transform: translateY(-3px);
        }
        .error-message {
          color: #ff6b81;
          font-size: 14px;
          margin-top: 5px;
          text-align: center;
          font-style: italic;
        }
        @media (max-width: 600px) {
          .app-container { padding: 15px; }
          .step-container { padding: 20px; }
          .step-title { font-size: 22px; }
          .btn { padding: 12px; }
        }
      `}
    </style>
    <div className="app-container">
      <div className="header">
        <h1>NOC Email Sender</h1>
        <div className="progress-bar">
          <div className="progress"></div>
        </div>
      </div>
      <div className="step-container">
        <h2 className="step-title">Step 1: Incident Details</h2>
        {groups.length === 0 && <p className="error-message">No recipient groups available.</p>}
        <div className="form-group">
          <label className="form-label">Recipient Group</label>
          <select
            name="recipient_group"
            value={formData.recipient_group}
            onChange={handleChange}
          >
            <option value="">Select</option>
            {groups.map(g => <option key={g} value={g}>{g}</option>)}
          </select>
        </div>
        <div className="form-group">
          <label className="form-label">Severity</label>
          <select
            name="severity"
            value={formData.severity}
            onChange={handleChange}
          >
            <option value="">Select</option>
            <option value="High">High</option>
            <option value="Medium">Medium</option>
            <option value="Low">Low</option>
          </select>
        </div>
        <div className="form-group">
          <label className="form-label">Trigger Name</label>
          <input
            name="trigger_name"
            value={formData.trigger_name}
            onChange={handleChange}
          />
        </div>
        <button
          onClick={nextStep}
          className="btn"
        >
          Next
        </button>
      </div>
    </div>
  </div>
);

export default Step1;
